// DeleteUniqueIndexCache 删除索引存在的缓存
func (a *AiPromptRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.AiPrompt) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, a.cache.Key(CacheAiPromptByConditionPrefix))
	keys = append(keys, a.cache.Key(CacheAiPromptUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[a.cache.Key(CacheAiPromptByIDPrefix, item.ID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiPromptUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiPromptByAdminIDPrefix, item.AdminID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiPromptUnscopedByAdminIDPrefix, item.AdminID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiPromptByTenantIDPrefix, item.TenantID)] = struct{}{}
			KeyMap[a.cache.Key(CacheAiPromptUnscopedByTenantIDPrefix, item.TenantID)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := a.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
